Aplicativo da Receita Federal do Brasil destinado às Pessoas Físicas. Nessa versão do APP Pessoa Física estão disponíveis os seguintes serviços: 

Serviços do CPF: 
- Consulta informações cadastrais sobre o CPF; 
- Geração do comprovante de inscrição (cartão) CPF; 
- Inscrição CPF - 1ª via (1); 
- Regularização de CPF suspensos (1); 
- Perguntas e Respostas sobre o CPF (1); 

Serviços do IRPF: 
- Consulta informações sobre a Restituição IRPF (desde 1999); 
- Envio de mensagens (alertas) sobre a Restituição IRPF; 
- Quiz - um teste de conhecimentos sobre o IRPF 
- Cálculo do imposto mensal e anual, para os anos calendários de 2012 a 2020; 
- Cronograma de lotes para pagamento de restituição (1); 
- Acesso à página do IRPF na internet (1); 
- Acesso ao Meu Imposto de Renda (2); 
- Perguntão IRPF (2); 
- Acompanhar Declaração (2); 

Outros serviços: 
- Consulta CNPJ (3);
- Unidades da RFB;
- Página da RFB na internet (1).

Funcionamento: 
(1) o aplicativo chamará o serviço já disponível na página da Receita Federal na internet. 
(2) o aplicativo acionará o APP IRPF, desde que instalado. 
(3) o aplicativo acionará o APP CNPJ, desde que instalado. 


Observações: 
1) o serviço Consulta CPF verifica informações CADASTRAIS nas bases da Receita Federal. Não há nenhuma ligação com serviços particulares de proteção ao crédito (SPC, Serasa...); 

2) Para consultar um CPF deverá ser informada também a data de nascimento.  A aplicação, além de validar a data de nascimento informada, exibirá a data de criação do CPF e a data de falecimento (se houver); 

3) Para Inscrição CPF (1ª via) é necessário possuir título de eleitor. 

4) A geração do comprovante de inscrição CPF (2ª via): 
a) somente será permitida para contribuintes que não apresentaram a declaração do imposto de renda em 2016 e 2017; 
b) contribuintes que apresentaram declaração IRPF em 2016 e 2017 devem continuar gerando seu comprovante de inscrição CPF no e-CAC; 
c) poderá ser solicitado o nome da mãe e/ou o título de eleitor, conforme a situação do contribuinte; 

5) A Regularização do CPF somente é possível para complementação de dados de inscrições suspensas e de pessoas não obrigadas a apresentar declaração IRPF. 

6) A consulta Restituição IRPF: 
a) Pode ser consultado o resultado da restituição IRPF desde 1999 
b) Caso a restituição esteja "em flia de espera", poderá ser assinalado o interesse em receber alertas (deve clicar na estrela amarela); 
c) Os alertas serão enviados quando a restituição do contribuinte for encaminhada para pagamento bancário. 

7) Meu Imposto de Renda é serviço que permite preencher, transmitir e consultar declarações do IRPF.

Sanepar Mobile é o aplicativo da Companhia de Saneamento do Paraná, destinado ao autoatendimento de clientes.

A Sanepar presta serviços para o abastecimento da população com água tratada, serviços de coleta e tratamento de esgoto sanitário, e de coleta seletiva e destinação de resíduos sólidos.

Com este aplicativo é possível:

- Verificar falta d’água;
- Saber onde pagar a conta;
- Localizar centrais de relacionamento;
- Consultar débitos e consumo;
- Obter código para pagamento;
- Atualizar dados cadastrais, data de vencimento e endereço alternativo;
- Solicitar serviços.

Este aplicativo é destinado para clientes de Planos odontológicos da MetLife Brasil, para produtos coletivos (Grupo) ou individuais. Ele oferece um meio fácil e rápido para acessar as informações do seu plano odontológico. Entre as funcionalidades, temos:

- Carteirinha Digital;
- Busca de Dentistas e Clínicas (Rede Credenciada);
- Histórico de tratamentos utilizando rede credenciada;
- Solicitação de prévia de reembolso (somente para beneficiários que tenham cobertura para tal) e acompanhamento de status;
- Solicitação de reembolso (somente para beneficiários que tenham cobertura para tal) e  acompanhamento de status;
- Informações de coberturas de acordo com o plano contratado;
- Informações cadastrais (endereços, dados de contato, etc);
- Dicionário para esclarecimento de termos odontológicos;
- notificações on-line a qualquer alteração de situação de seus tratamentos e processos de reembolso;
- Informações de Contato - Chat + Telefone 
 - Avaliar um prestador (dentista / clínica)

Experimente toda a experiência do Sebrae na palma da sua mão.

Com o objetivo de facilitar o dia a dia dos pequenos negócios, o App Sebrae ajuda você a tirar a sua ideia do papel a gerir o seu negócio a partir de informações de mercado, recomendação de serviços financeiros, acesso a soluções de capacitação voltadas para o seu desenvolvimento e muito mais... Com o App Sebrae você ganha mais tempo para se relacionar com seus clientes. 

Confira as jornadas que o App Sebrae oferece para você:

- Capacite-se com cursos, eventos e conteúdos;
- Emita e controle seus boletos DAS MEI;
- Agende atendimento com o Sebrae;
- Tire suas dúvidas com nosso assistente digital
- Identifique a melhor opção de serviços financeiros: maquininha e conta-corrente para o seu negócio;
- Identifique as melhores opções de marketplace para o seu negócio;
- Entenda o mercado e conheça números do seu segmento;
- Controle o fluxo de caixa de seu negócio;
- Encontre fornecedores para sua demanda;
- Localize o Sebrae mais próximo de você;

Conheça as seções do aplicativo do Sebrae:

- PRA VOCÊ: tudo o que você precisa saber para ajudar no seu crescimento pessoal como empreendedor: seu histórico de relacionamento com o Sebrae, seus compromissos, avaliações, cursos online em andamento, dicas de empreendedorismo e indicação do Sebrae mais próximo de você.

- PRA SUA EMPRESA: todas as informações e funcionalidades que sua empresa precisa para crescer: cards com os CNPJs de empresas próprias e associadas a você, diagnósticos, boletos DAS (para MEIs), fluxo de caixa, informações de mercado do segmento de seu negócio, recomendação de marketplaces, fornecedores de produtos e serviços e recomendação de serviços financeiros.

- APRENDA: vitrine de cursos, eventos e conteúdos do Sebrae e parceiros.

- AJUDA: tire suas dúvidas com nosso assistente digital inteligente ou fale com o um de nossos atendentes.

- NOTIFICAÇÕES: receba alertas com dicas, servido e informações personalizadas importantes para você e para o seu negócio;

- AGENDA: agende o seu atendimento presencial ou online com e equipe Sebrae.

- AJUSTES: configure seus dados, seus interesses e suas configurações para ajudar na melhor utilização do aplicativo.
